import React from 'react';

const FaceRecognition = ({imageUrl, namesList}) => {
    return(

        <div className=' cf flex flex-wrap'>

            <div className='br3 pa3 w-50'>
               <img className='br3' src={imageUrl} alt='' />


            </div>
            <div className='w-30 pa3 '>
            {namesList}
            </div>
        </div>
    );
}

export default FaceRecognition;
